INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 7001, 0.0, 1, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 7002, 0.0, 1, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 7003, 0.0, 1, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 10001, 0.0, 1, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 10002, 0.0, 1, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 10003, 0.0, 1, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 10004, 0.0, 1, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 12001, 0.0, 1, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 13001, 0.0, 1, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 13002, 0.0, 1, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 13003, 0.0, 1, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 13004, 0.0, 1, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 14001, 0.0, 1, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 14002, 0.0, 1, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 14003, 0.0, 1, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 14004, 0.0, 1, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -470.0, 0.0, 0, 105901, 0, "コッコロ", 1, 15001, 0.0, 1, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 16001, 0.0, 1, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 16002, 0.0, 1, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 16003, 0.0, 1, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 16004, 0.0, 1, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 17002, 0.0, 1, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 17004, 0.0, 1, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 17005, 0.0, 1, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 17006, 0.0, 1, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 17007, 0.0, 1, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 190801, 0, "カリン", 1, 18001, 0.0, 1, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 190801, 0, "カリン", 1, 18002, 0.0, 2, 18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -470.0, 0.0, 0, 190801, 0, "カリン", 1, 19001, 0.0, 3, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -470.0, 0.0, 0, 190801, 0, "カリン", 1, 19002, 0.0, 4, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -470.0, 0.0, 0, 190801, 0, "カリン", 1, 20001, 0.0, 5, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -470.0, 0.0, 0, 190801, 0, "カリン", 1, 20002, 0.0, 6, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 21001, 0.0, 1, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 21002, 0.0, 1, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 21003, 0.0, 1, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 21004, 0.0, 1, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -430.0, 0.0, 0, 190801, 0, "カリン", 1, 22001, 0.0, 1, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -430.0, 0.0, 0, 190801, 0, "カリン", 1, 22002, 0.0, 2, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -430.0, 0.0, 0, 190801, 0, "カリン", 1, 23001, 0.0, 3, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -430.0, 0.0, 0, 190801, 0, "カリン", 1, 23002, 0.0, 4, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 4.08, 10011, 109001, 0, "エリコ（バレンタイン）", 1, 24001, 8.0, 1, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 5.0, 10011, 109001, 0, "エリコ（バレンタイン）", 1, 24002, 8.0, 2, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 10.11, 10011, 109001, 0, "エリコ（バレンタイン）", 1, 24003, 8.0, 3, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 4.0, 10011, 109001, 0, "エリコ（バレンタイン）", 1, 24004, 8.0, 4, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 6.0, 10011, 109001, 0, "エリコ（バレンタイン）", 1, 24005, 8.0, 5, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109002, 0, "エリコ（バレンタイン）", 1, 24006, 0.0, 6, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109002, 0, "エリコ（バレンタイン）", 1, 24007, 0.0, 7, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109002, 0, "エリコ（バレンタイン）", 1, 24008, 0.0, 8, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109002, 0, "エリコ（バレンタイン）", 1, 24009, 0.0, 9, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109002, 0, "エリコ（バレンタイン）", 1, 24010, 0.0, 10, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 2.12, 10011, 109101, 0, "シズル（バレンタイン）", 1, 24011, 8.0, 1, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 4.19, 10011, 109101, 0, "シズル（バレンタイン）", 5, 24012, 8.0, 2, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (4, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 2.3, 10011, 109101, 0, "シズル（バレンタイン）", 2, 24013, 8.0, 3, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109102, 0, "シズル（バレンタイン）", 1, 24014, 0.0, 4, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 5.23, 10011, 109101, 0, "シズル（バレンタイン）", 5, 24015, 8.0, 5, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109102, 0, "シズル（バレンタイン）", 1, 24016, 0.0, 6, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 5.01, 10011, 109101, 0, "シズル（バレンタイン）", 1, 24017, 8.0, 7, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109102, 0, "シズル（バレンタイン）", 1, 24018, 0.0, 8, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109102, 0, "シズル（バレンタイン）", 1, 24019, 0.0, 9, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 0.0, 10011, 109102, 0, "シズル（バレンタイン）", 1, 24020, 0.0, 10, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 26001, 0.0, 1, 26, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 26002, 0.0, 1, 26, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 26003, 0.0, 1, 26, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 26004, 0.0, 1, 26, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 2, 27001, 0.0, 1, 27, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 27002, 0.0, 1, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 27003, 0.0, 1, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 27004, 0.0, 1, 27, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/09/24 15:00:00", -363.0, 0.0, 0, 190801, 0, "カリン", 1, 28001, 0.0, 1, 28, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！");
