INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/09/24 15:00:00", -409.0, 0.0, 0, 190801, 0, "カリン", 1, 29001, 0.0, 3, 29, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/09/24 15:00:00", -409.0, 0.0, 0, 190801, 0, "カリン", 1, 29002, 0.0, 4, 29, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/09/24 15:00:00", -409.0, 0.0, 0, 190801, 0, "カリン", 1, 30001, 0.0, 5, 30, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！");
