INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/10/31 12:00:00", -409.0, 0.0, 0, 190801, 0, "カリン", 1, 31001, 0.0, 7, 31, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2019/10/31 12:00:00", -409.0, 0.0, 0, 190801, 0, "カリン", 1, 31002, 0.0, 8, 31, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2020/01/04 4:59:59", "2019/12/20 5:00:00", -409.0, 0.0, 0, 190801, 0, "カリン", 1, 32001, 0.0, 1, 32, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！");
