INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -458.0, 5.3, 0, 105801, 0, "ペコリーヌ", 1, 38001, 0.0, 1, 38, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -458.0, 6.5, 0, 105801, 0, "ペコリーヌ", 1, 38002, 0.0, 2, 38, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (3, "2020/04/08 23:59:59", "2020/04/01", 9999.0, 0.0, 0, 105801, 0, "ペコリーヌ", 3, 39005, 9999.0, 0, 39, "");
