INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106401, 2104010, "シェフィ", 1, 41001, 0.0, 1, 41, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 41002, 0.0, 1, 41, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 41003, 0.0, 1, 41, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 41004, 0.0, 1, 41, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 0.0, 0, 105901, 0, "コッコロ", 1, 42001, 0.0, 1, 42, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 0.0, 0, 106401, 2104010, "シェフィ", 1, 42002, 0.0, 1, 42, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 42003, 0.0, 1, 42, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 0.0, 0, 106001, 0, "キャル", 1, 42004, 0.0, 1, 42, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105801, 0, "ペコリーヌ", 1, 43001, 0.0, 1, 43, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 105901, 0, "コッコロ", 1, 43002, 0.0, 1, 43, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 0.0, 0, 106001, 0, "キャル", 1, 43003, 0.0, 1, 43, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 0.0, 0, 123001, 0, "アメス", 1, 43004, 0.0, 1, 44, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 0.0, 0, 123001, 0, "アメス", 1, 43005, 0.0, 2, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (2, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 5.79, 0, 123001, 0, "アメス", 1, 43006, 0.0, 3, 45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
